// -------------------- Import --------------------
import React from "react";

// -------------------- Row Table List --------------------
export default function RowTable(props) {
// sittings
  const category_data = props.category_data,
    points_name = props.points_name;

  return (
    <tr>
{/* name */}
      <td>{category_data.PLAYER_NAME || category_data.TEAM_CITY}</td>
{/* points  */}
      <td>{category_data[points_name]}</td>
      <td>
{/* like  */}
        <button
          onClick={() => {
            props.like(category_data);
          }}
        >
          like
        </button>
      </td>
    </tr>
  );
}
